css:
@-moz-document domain(github.com) {
    /* Days */
    rect.day[fill="#c6e48b"] {
      fill: #feef4d !important;
    }
    rect.day[fill="#7bc96f"] {
      fill: #fdc600 !important;
    }
    rect.day[fill="#239a3b"] {
      fill: #fd9603 !important;
    }
    rect.day[fill="#196127"] {
      fill: #040021 !important;
    }

    /* Legend */
    ul.legend > li[style="background-color: #c6e48b"] {
      background-color: #feef4d !important;
    }
    ul.legend > li[style="background-color: #7bc96f"] {
      background-color: #fdc600 !important;
    }
    ul.legend > li[style="background-color: #239a3b"] {
      background-color: #fd9603 !important;
    }
    ul.legend > li[style="background-color: #196127"] {
      background-color: #040021 !important;
    }
}
